## Tooltip

A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

## Creating a Tooltip

To create a Tooltip in NextJS using React Context, we will first create a TooltipContext. This context will hold the state of the Tooltip, such as whether it is open or closed, and the content of the Tooltip.

We will then create a Tooltip component that uses the TooltipContext to open and close the Tooltip. The Tooltip component will render a button that, when clicked, will open the Tooltip. The Tooltip component will also render the Tooltip content when it is open.

To close the previously opened Tooltip, we will use the useEffect hook in the Tooltip component to listen for changes in the TooltipContext state. When the TooltipContext state changes, the useEffect hook will close the previously opened Tooltip by setting its state to closed.

Here is an example of how to create a Tooltip in NextJS using React Context:

```
import React, { createContext, useContext, useEffect, useState } from 'react';

const TooltipContext = createContext();

export function useTooltipContext() {
  return useContext(TooltipContext);
}

export function TooltipProvider({ children }) {
  const [openTooltipId, setOpenTooltipId] = useState(null);

  const openTooltip = (id) => {
    setOpenTooltipId(id);
  };

  const closeTooltip = () => {
    setOpenTooltipId(null);
  };

  useEffect(() => {
    return () => {
      closeTooltip();
    };
  }, []);

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, openTooltipId }}>
      {children}
    </TooltipContext.Provider>
  );
}

export function Tooltip({ id, children }) {
  const { openTooltipId, closeTooltip } = useTooltipContext();

  useEffect(() => {
    if (openTooltipId === id) {
      return;
    }

    closeTooltip();
  }, [id, openTooltipId]);

  if (openTooltipId !== id) {
    return children;
  }

  return (
    <div className="tooltip">
      {children}
      <div className="tooltip-content">Tooltip Content</div>
    </div>
  );
}
```

