The Tooltip component uses the TooltipContext to open and close the Tooltip. The Tooltip component also renders the Tooltip content when it is open.

To close the previously opened Tooltip, we use the useEffect hook in the Tooltip component to listen for changes in the TooltipContext state. When the TooltipContext state changes, the useEffect hook will close the previously opened Tooltip by setting its state to closed.

